import React, { useEffect, useState } from "react";
import { useUserForm } from "../../hooks/Custom.hook";
import { Link } from "react-router-dom";

export const UserForm = () => {

  const { form, setForm, handleChanges } = useUserForm();
  const [areEquals, setAreEquals] = useState(true);
  const [passwordConfirmation, setpasswordConfirmation] = useState();

  const handlePasswordConfirmation = (e) => {
    setpasswordConfirmation(e.target.value);
  }

  useEffect(() => {
    const { password } = form;
    setAreEquals(password===passwordConfirmation);
  }, [passwordConfirmation])

  const handleSubmit = (e) => {
    e.preventDefault()
  };

  return (
    <div className="w-25 mx-auto mt-5">
      <h4 className="mb-3">Humano Registrate</h4>

      <form>
        <div className="row mb-3">
          <label for="inputEmail3" className="col-sm-2 col-form-label">
            Email
          </label>
          <div className="col-sm-10">
            <input
              type="email"
              className="form-control"
              name="email"
              onChange={handleChanges}
            />
          </div>
        </div>

        <div className="row mb-3">
          <label for="inputPassword3" className="col-sm-2 col-form-label">
            Clave
          </label>
          <div className="col-sm-10">
            <input
              type="password"
              className="form-control"
              name="password"
              onChange={handleChanges}
            />
          </div>
        </div>

        <div className="row mb-3">
          <label for="inputPassword3" className="col-sm-2 col-form-label">
            Repetir Clave
          </label>
          <div className="col-sm-10">
            <input 
            type="password" 
            className="form-control"  
            onChange={handlePasswordConfirmation}/>
            {!areEquals && (
              <div className="form-text list-group-item-success">
                Las Claves no son iguales

              </div>
            )}
          </div>
        </div>


        <hr className="my-4"></hr>

        <div className="row g-3">
        <button 
        type="submit" 
        className="btn btn-success"
        onClick={handleSubmit}>
          Sign in
        </button>

        <Link to={"/"} className="btn btn-outline-dark me-2">Volver</Link>
        </div>
      </form>
    </div>
  );
};
